import React from 'react'
import ArtItems from '../components/ArtItems.js'

const Art = () => {
  return (
    <div>
      <img src={require('./Untitled.png')} alt="nope"/>
      {ArtItems.map((artItem, i) => {
        return <div><img src={require(artItem.image)}/></div>
      })}
    </div>
  )
}

export default Art
